Insert two elements in $push with a $cond in Mongodb<p>I have this query in <code>mongodb</code>, which represent the won team will have 3 points and the draw teams will have 1 each. </p>

<pre><code>
db.football.aggregate([ 
  { "$match": {
      "$and": [
        { "Div": "SP1" }
      ]
    }
  },
  { "$group": { 
      "_id": {
        "div": "$Div"
      },
      "teams": { 
        "$push": {
          "$cond": {
            "if": { "$eq": [ "$FTR", "H" ] }, 
            "then": { "T": "$HomeTeam", "P": 3 },
            "else": {
              "$cond": {
                "if": { "$eq": [ "$FTR", "A" ] }, 
                "then": { "T": "$AwayTeam", "P": 3 },
                "else": {
                  "$cond": {
                    "if": { "$eq": [ "$FTR", "D" ] }, 
                    "then": { "draws": [{ "T": "$HomeTeam", "P": 1}, { "T": "$AwayTeam", "P": 1 }] },
                    "else": "Error" 
                  }
                }
              }
            }
          }
        }
      }
    }
  }
])
</code></pre>

<p>Which result in:</p>

<pre><code>{ "_id" : { "div" : "SP1" }, 
          "teams" : [ 
                      { "T" : "La Coruna", "P" : 3 },
                      { "T" : "Malaga", "P" : 3 },
                      { "draws": [
                                   { "T" : "Barcelona", "P" : 1 },
                                   { "T" : "Villarreal", "P" : 1 }
                                 ]
                      },
                     ...
                    ]
}

</code></pre>

<p>See that I have an array for the draws teams, but I just want a big array in teams as the below:</p>

<pre><code>{ "_id" : { "div" : "SP1" }, 
          "teams" : [ 
                      { "T" : "La Coruna", "P" : 3 },
                      { "T" : "Malaga", "P" : 3 },
                      { "T" : "Barcelona", "P" : 1 },
                      { "T" : "Villarreal", "P" : 1 },
                     ...
                    ]
}

</code></pre>

<p>I have tried to <code>unwind</code> teams field but wasn't effective.  </p>

<p>The dataset can be download here: <a href="https://www.football-data.co.uk/mmz4281/1617/SP1.csv" rel="nofollow noreferrer">https://www.football-data.co.uk/mmz4281/1617/SP1.csv</a>
The information of the dataset: <a href="https://www.football-data.co.uk/notes.txt" rel="nofollow noreferrer">https://www.football-data.co.uk/notes.txt</a></p>

<p>To import the csv:</p>

<pre><code>mongoimport -d dataset -c football --type csv --file path_to_file_SP1.csv --headerline --drop --stopOnError
</code></pre>

