Update a MongoDB array with Push and Slice<p>I have a document in MongoDB that I want to update. In this example, I have a property (events.properties.color) that's an array with multiple (duplicate) values. </p>

<pre><code>{ 
    "_id" : ObjectId("5d91fd51abe17b722ca9c82c"),  
    "createdDate" : ISODate("2019-09-30T13:04:15.077+0000"), 
    "title" : "My Old Car", 
    "version" : NumberInt(0) 
    "events" : [
        { 
            "properties" : {
                "color" : [
                    "red", 
                    "red", 
                    "red", 
                    "red"
                ]
            }, 
            "attributes" : {
                "MAKE" : "TOYOTA", 
                "MODEL" : "COROLLA", 
                "YEAR" : "1991", 
            }
        }
    ]
}
</code></pre>

<p>I want to change this array to a string with a single value (red). For my data, I can assume that every value in the array is the same, so the value of the string can just be the first value in the array. 
I was trying to iterate through my collection with something like this: </p>

<pre><code>db.getCollection('cars').update(
    [
        // Match array with &gt;1 value
        { $match: { 'events.properties.color.2': {$exists: true} } },

        {
            //Slice to only include first value in array. 
