                'events.$.properties.color':{
                    $each: [ ],
                    $slice: 1
                }
            }
        }
    ]
)
</code></pre>

<p>But I keep getting an error: "Need an object", which (I think) means that I'm not referencing the color array properly. Any ideas on what I should change? 
Thanks!</p>

