Bad request ( 400 ) at trying to use api to authenticate NODE + REACT<p>I made an API with NodeJS to register and login an user and also to generate a token. 
Using the API with POSTMAN it works just fine but when I added the React and I try to login with a user, I receive an error ( 400 ) bad request. Trying to debug it I found that the data it's been passed by the front-end but the server is not receiving.
So I guess the problem it is on the servers side.</p>

<p>All the code I uploaded here: <a href="https://github.com/drrh12/auth-login" rel="nofollow noreferrer">https://github.com/drrh12/auth-login</a>
And I will be posting the pictures below:</p>

<p><a href="https://i.stack.imgur.com/jQDWw.png" rel="nofollow noreferrer">Console desc error</a></p>

<p><a href="https://i.stack.imgur.com/HKOp3.png" rel="nofollow noreferrer">Network desc error</a></p>

<p><a href="https://i.stack.imgur.com/N5DNr.png" rel="nofollow noreferrer">Using POSTMAN</a></p>

<p><strong>NODE JS authentication file.</strong></p>

<pre><code>const router = require('express').Router();
const User = require('../model/User');
const{registerValidation, loginValidation} = require('../validation');
const jwt = require('jsonwebtoken');
const bcrypt = require('bcryptjs');

router.post('/register', async (req, res) =&gt; {

    const { error } = registerValidation(req.body);
    if (error) return res.status(400).send(error.details[0].message);

    //Check user in data base
    const emailExist = await User.findOne({
        email: req.body.email    
    });
    if(emailExist) return res.status(400).send('Email already exist');

    //Hash Pass
    const salt = await bcrypt.genSalt(10);
    const hashedPassword = await bcrypt.hash(req.body.password, salt);


    //Creating a new user
    const user = new User({
        name: req.body.name,
        email: req.body.email,
        password: hashedPassword
    });

    try{
        const savedUser = await user.save();
        res.send(savedUser);
    }catch(err){
        res.status(400).send(err)
    }
})


router.post('/login', async (req, res) =&gt; {

    const { error } = loginValidation(req.body);
    if (error) return res.status(400).send(error.details[0].message);

        const user = await User.findOne({ email: req.body.email });
        if(!user) return res.status(400).send('Email or pass is wrong');

        const validPass = await bcrypt.compare(req.body.password, user.password);
        if(!validPass) return res.status(400).send('Invalid pass')

        //Token
        const token = jwt.sign({_id: user.id}, process.env.TOKEN_SECRET);
        res.header('auth-token', token).send(token);

        res.send('Logged in');    
});

module.exports = router;
</code></pre>

<p><strong>Validation Schema</strong></p>

<pre><code>const Joi = require('@hapi/joi');

const registerValidation = data =&gt; {
    const schema = Joi.object({
      name: Joi.string()
        .min(3)
        .required(),
      email: Joi.string()
        .min(3)
        .required()
        .email(),
      password: Joi.string()
        .min(3)
        .required()
    });
    return schema.validate(data);
  };

const loginValidation = data =&gt; {
    const schema = Joi.object({
      email: Joi.string()
        .min(3)
        .required(),
      password: Joi.string()
        .min(3)
        .required()
    });
    return schema.validate(data);
  };

module.exports.registerValidation = registerValidation;
module.exports.loginValidation = loginValidation;
</code></pre>

