embedfield:
Aggregate and reduce a nested array based upon an ObjectId<p>I have an <code>Event</code> document structured like so and I'm trying to query against the <code>employeeResponses</code> array to gather all responses (which may or may not exist) for a single employee:</p>

<pre><code>[
  { 
    ...
    eventDate: 2019-10-08T03:30:15.000+00:00,
    employeeResponses: [
      {
        _id:"5d978d372f263f41cc624727", 
        response: "Available to work.", 
        notes: ""
      },
      ...etc
    ];
  }
];
</code></pre>

<p>My current mongoose aggregation is:</p>

<pre><code>const eventResponses = await Event.aggregate([
  {
    // find all events for a selected month
    $match: {
      eventDate: {
        $gte: startOfMonth,
        $lte: endOfMonth,
      },
    },
  },
  {
    // unwind the employeeResponses array
    $unwind: {
      path: "$employeeResponses",
      preserveNullAndEmptyArrays: true,
    },
  },
  {
    $group: {
      _id: null,
      responses: {
        $push: {
          // if a response id matches the employee's id, then 
          // include their response; otherwise, it's a "No response."
          $cond: [
            { $eq: ["$employeeResponses._id", existingMember._id] },
            "$employeeResponses.response",
            "No response.",
          ],
        },
      },
    },
  },
  { $project: { _id: 0, responses: 1 } },
]);
</code></pre>

<p>As you'll no doubt notice, the query above won't work after more than 1 employee records a response because it treats each individual response as a T/F condition, instead of <strong>all of the responses</strong> within the <code>employeeResponses</code> array as a single T/F condition.</p>

<p>As a result, I had remove all subsequent queries after the initial <code>$match</code> and do a manual reduce:</p>

<pre><code>const responses = eventResponses.reduce((acc, { employeeResponses }) =&gt; {
  const foundResponse = employeeResponses.find(response =&gt; response._id.equals(existingMember._id));

  return [...acc, foundResponse ? foundResponse.response : "No response."];
}, []);
</code></pre>

<p><strong>I was wondering if it's possible to achieve the same reduce result above, but perhaps using mongo's <code>$reduce</code> function? Or refactor the aggregation query above to treat all responses within the <code>employeeResponses</code> as a single T/F condition?</strong> </p>

<p>The ultimate goal of this aggregation is extract any previously recorded employee's responses and/or lack of a response from each found <code>Event</code> within a current month and place their responses into a single array:</p>

<pre><code>["I want to work.", "Available to work.", "Not available to work.", "No response.", "No response." ...etc]
</code></pre>

