Only objectID is saved in the array in another model in mongodb<p>I have two models in my mongoDB. One is <code>user</code> model and one is <code>event</code> model. What I want to achieve is, when I will add a new event then, that <strong>event array</strong> will save to my <strong>user model's events</strong> column array. Till now, I've successfully saved that <strong>id</strong> of that event to specific <code>user but the problem is only the **objectID** is coming not the property is showing up like</code>event name<code>,</code>descriptions`. This is my code:</p>

<p><strong>user model:</strong></p>

<pre><code>const userSchema =  mongoose.Schema({
    name: String,
    events: [
        { 
            type: Schema.Types.ObjectId, 
            ref: 'Event' 
        }
    ]
});
</code></pre>

<p><strong>Event model:</strong></p>

<pre><code>const eventSchema = new Schema({
    creator: {
        type: Schema.Types.ObjectId,
        ref: 'User'
    },
    ename: {
        type: String
    },
    description: {
        type: String
    },
});
</code></pre>

<p><strong>routes.js</strong></p>

<pre><code>router.post('/', (req, res) =&gt; {

  const event = new Event();
  event.creator = '5d9e1ba694f44227e1f54cc0',
  event.ename = req.body.ename;

  event.save( (err, result) =&gt; {
      if (!err)
          res.redirect('events');
      else {
          console.log('error', err);
      }
  }); 
  User.findOneAndUpdate('5d9e1ba694f44227e1f54cc0', {$push: { events: [event] }}, (err, result) =&gt; {
      if(err) {
          console.log(err);
      } else {
          console.log('event is saved');
      }
  });

});
</code></pre>

<p>for simplicity, I've kept my user id hardcoded. Now, how can I update the <code>$push</code> method of the mongodb so that the whole properties of the event is to save in the <code>user</code> model not only the objectID</p>

