<p>This is the code:</p>

<pre><code>router.route('carousel/update/:id').put(function(req, res) {
var data = req.body;
const myquery = {"_id": ObjectId };

db.collection("home").updateOne(myquery, {
    $set: {
        "img": data.img,
        "header": data.header,
        "subheader": data.subheader
    }
}, (err, results) =&gt; {
   res.status(200).json({status: "ok"})}
})
</code></pre>

<p>This chunk of code allows me to update the first only the first object in my collection. How do i configure it otherwise in order to allow updating specific objects using the _id? What am I missing?</p>

