          createdOn: "2019-05-15T06: 00: 00"
        }
      ]
    }
]
</code></pre>

<p>And following query:</p>

<pre><code>db.customers.aggregate([
  {
    $lookup: {
      from: "vehicles",
      let: {
        uuid: "$uuid"
      },
      pipeline: [
        {
          $match: {
            $expr: {
              $in: [
                "$$uuid",
                "$users.uuid"
              ]
            }
          }
        },
        {
          $project: {
            model: 1,
            users: {
              $filter: {
                input: "$users",
                as: "user",
                cond: {
                  $eq: [
                    "$$user.uuid",
                    "$$uuid"
                  ]
                }
              }
            }
          }
        },
        {
          $unwind: "$users"
        },
        {
          $replaceRoot: {
            newRoot: {
              isOwner: "$users.isOwner",
              createdOn: "$users.createdOn"
            }
          }
        }
      ],
      as: "vehicles"
    }
  },
  {
    $facet: {
      "createdOn": [
        {
          $match: {
            "vehicles": {
              $elemMatch: {
                isOwner: true,
                $and: [
                  {
                    "createdOn": {
                      $gte: "2019-05-15T00: 00: 00"
                    }
                  },
                  {
                    "createdOn": {
                      $lt: "2019-05-16T00: 00: 00"
                    }
                  }
                ]
              }
            }
          }
        },
        {
          $project: {
            culture: 1,
            count: {
              $size: "$vehicles"
            }
          }
        },
        {
          $group: {
            _id: 0,
            "total": {
              $sum: "$count"
            }
          }
        }
      ]
    }
  },
  {
    $project: {
      "CreatedOn": {
        $arrayElemAt: [
          "$CreatedOn.total",
          0
        ]
      }
    }
  }
])
</code></pre>

<p>I get following result:</p>

<pre><code>[
  {
    "createdOn": 2
  }
]
</code></pre>

<p>What I would like to achieve is a result as follows:</p>

<pre><code>[
    {
        culture: "it-it",
        results: {
            "createdOn": 1
        }
    },
    {
        culture: "de-de",
        results: {
            "createdOn": 1
        }
    }
]
</code></pre>

<p>But I cannot seem to figure out where I can group so that I can get that result.
Can someone show me the way to do this?</p>

<p>The query is more complex with more metrics so this is a trimmed down version of what I have.</p>

<p>I tried grouping everywhere but fail to get the desired result I want.</p>

